/*!50003 CREATE*/ /*!50017 DEFINER=`daisl07_dsiproyecto03`@`%`*/ /*!50003 TRIGGER `generar_IdCategoria` BEFORE INSERT ON `Categoria` FOR EACH ROW BEGIN
    DECLARE ultimo_id INT;
    DECLARE nuevo_id VARCHAR(11);
    
    -- Obtener el ltimo ID insertado
    SELECT SUBSTRING(IdCategoria, 4) INTO ultimo_id
    FROM Categoria
    ORDER BY IdCategoria DESC
    LIMIT 1;
    
    -- Generar el nuevo ID
    IF ultimo_id IS NULL THEN
        SET nuevo_id = 'CAT001';
    ELSE
        SET nuevo_id = CONCAT('CAT', LPAD(ultimo_id + 1, 3, '0'));
    END IF;
    
    -- Asignar el nuevo ID a la fila a insertar
    SET NEW.IdCategoria = nuevo_id;
END */;;
DELIMITER ;
