/*!50003 CREATE*/ /*!50017 DEFINER=`daisl07_dsiproyecto03`@`%`*/ /*!50003 TRIGGER `generar_IdConsumible` BEFORE INSERT ON `Consumible` FOR EACH ROW BEGIN
    DECLARE ultimo_id INT;
    DECLARE nuevo_id VARCHAR(11);
    
    -- Obtener el ltimo nmero de ID insertado
    SELECT SUBSTRING(IdConsumible, 6) INTO ultimo_id
    FROM Consumible
    WHERE SUBSTRING(IdConsumible, 1, 5) = 'Consu'
    ORDER BY CAST(SUBSTRING(IdConsumible, 6) AS UNSIGNED) DESC
    LIMIT 1;
    
    -- Generar el nuevo ID
    IF ultimo_id IS NULL THEN
        SET nuevo_id = 'Consu001';
    ELSE
        SET nuevo_id = CONCAT('Consu', LPAD(ultimo_id + 1, 3, '0'));
    END IF;
    
    -- Asignar el nuevo ID a la fila a insertar
    SET NEW.IdConsumible = nuevo_id;
END */;;
DELIMITER ;
